import './activityList.scss'

export default function acitvityList({ id, title, active, setSelected }) {
  return (
    <li
      className={active ? 'acitvityList active' : 'acitvityList'}
      onClick={() => setSelected(id)}
    >
      {title}
    </li>
  )
}
